import dataCodir from './dataCodir';

const Groupe5 = () => {

   const data= dataCodir.map((data)=>(
      <div>
               <a href={data.ref} target='_blank' rel='noreferrer'>
               <img 
               style={{
                  borderRadius:'50%'
               }}
                height='30%'
                src={data.photo} alt=''/>
               </a>

               <h4>{data.name}</h4>
               <h6>{data.poste}</h6>

      </div>

   ))

    return (
        <div className='container'>
        <div className='gridr3'>
           {data} 
        </div>



     </div>
    )
  }

export default Groupe5;
